// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./IHederaTokenService.sol";

contract LynxMinter {
    address public immutable LYNX_TOKEN;
    address public immutable SAUCE_TOKEN;
    address public immutable CLXY_TOKEN;
    address public HTS_PRECOMPILE = address(0x0000000000000000000000000000000000000167);
    IHederaTokenService public hts;

    event LynxMinted(address indexed user, uint256 lynxAmount, uint256 hbarAmount, uint256 sauceAmount, uint256 clxyAmount);
    event LynxBurned(address indexed user, uint256 lynxAmount, uint256 hbarAmount, uint256 sauceAmount, uint256 clxyAmount);

    error InsufficientHBAR();
    error InsufficientSauceAllowance();
    error InsufficientClxyAllowance();
    error InsufficientLynxBalance();
    error InvalidAmount();
    error TokenAssociationFailed();
    error TokenTransferFailed();

    constructor(address lynxToken, address sauceToken, address clxyToken) {
        LYNX_TOKEN = lynxToken;
        SAUCE_TOKEN = sauceToken;
        CLXY_TOKEN = clxyToken;
        hts = IHederaTokenService(HTS_PRECOMPILE);
    }

    function setMockHtsPrecompile(address mockHtsPrecompile) external {
        HTS_PRECOMPILE = mockHtsPrecompile;
        hts = IHederaTokenService(mockHtsPrecompile);
    }

    receive() external payable {}

    function associateTokens() external {
        // Associate LYNX token
        int64 response1 = hts.associateToken(address(this), LYNX_TOKEN);
        if (response1 != 0) revert TokenAssociationFailed();

        // Associate SAUCE token
        int64 response2 = hts.associateToken(address(this), SAUCE_TOKEN);
        if (response2 != 0) revert TokenAssociationFailed();

        // Associate CLXY token
        int64 response3 = hts.associateToken(address(this), CLXY_TOKEN);
        if (response3 != 0) revert TokenAssociationFailed();
    }

    function mint(uint256 amount) external payable {
        if (msg.value < amount) revert InsufficientHBAR();

        // Check SAUCE allowance
        uint256 sauceAllowance = hts.allowance(SAUCE_TOKEN, msg.sender, address(this));
        if (sauceAllowance < amount) revert InsufficientSauceAllowance();

        // Check CLXY allowance
        uint256 clxyAllowance = hts.allowance(CLXY_TOKEN, msg.sender, address(this));
        if (clxyAllowance < amount) revert InsufficientClxyAllowance();

        // Transfer SAUCE from user to contract
        int64 response1 = hts.transferToken(SAUCE_TOKEN, msg.sender, address(this), amount);
        if (response1 != 0) revert TokenTransferFailed();

        // Transfer CLXY from user to contract
        int64 response2 = hts.transferToken(CLXY_TOKEN, msg.sender, address(this), amount);
        if (response2 != 0) revert TokenTransferFailed();

        // Mint LYNX to user
        int64 response3 = hts.mintToken(LYNX_TOKEN, amount, new bytes[](0));
        if (response3 != 0) revert TokenTransferFailed();

        // Transfer LYNX to user
        int64 response4 = hts.transferToken(LYNX_TOKEN, address(this), msg.sender, amount);
        if (response4 != 0) revert TokenTransferFailed();

        emit LynxMinted(msg.sender, amount, amount, amount, amount);
    }

    function burn(uint256 amount) external {
        if (amount == 0) revert InvalidAmount();

        // Check LYNX balance
        uint256 lynxBalance = hts.balanceOf(LYNX_TOKEN, msg.sender);
        if (lynxBalance < amount) revert InsufficientLynxBalance();

        // Transfer LYNX from user to contract
        int64 response1 = hts.transferToken(LYNX_TOKEN, msg.sender, address(this), amount);
        if (response1 != 0) revert TokenTransferFailed();

        // Burn LYNX
        int64 response2 = hts.burnToken(LYNX_TOKEN, amount, new bytes[](0));
        if (response2 != 0) revert TokenTransferFailed();

        // Transfer SAUCE back to user
        int64 response3 = hts.transferToken(SAUCE_TOKEN, address(this), msg.sender, amount);
        if (response3 != 0) revert TokenTransferFailed();

        // Transfer CLXY back to user
        int64 response4 = hts.transferToken(CLXY_TOKEN, address(this), msg.sender, amount);
        if (response4 != 0) revert TokenTransferFailed();

        // Transfer HBAR back to user
        (bool success,) = payable(msg.sender).call{value: amount}("");
        if (!success) revert TokenTransferFailed();

        emit LynxBurned(msg.sender, amount, amount, amount, amount);
    }
}

